  return (
    <div className="row">
      <div className="col">
        <ApiProgress>
          <UserSignupPage />
        </ApiProgress>
      </div>
      <div className="col">
      <ApiProgress>
          <UserLoginPage />
        </ApiProgress>
      </div>

      <LanguageSelector />
    </div>
  );
}

export default App;
